    //   (error) => {
    //     console.log(error);
    //   }
    // );
    console.log(SAMPLEDATA.items)
  }, []);

  return (
    <div>
      <div>
      <input type="text"  placeholder="Search Flickr by Tags" onChange={(e) => setSearchText(e.target.value)}/><button type="button" className="btn btn-light">Search</button>
      </div>
      <section className="card-container">
        {SAMPLEDATA.items.map((val, key) => {
            return (<div className="card" key={key}>
            <img src={val.media.m}/>  
            <p>{val.title}</p>  
            </div>);
        })}
      </section>
    </div>
  );
};

export default Home;
